import React, {Component} from "react";
import './style.css';
class Error extends Component{
    render() {
        return(

            <div class="bloc">
                <img src="assets/images/errors.png" width="600px" height="170px"/>
                <p class="text">You have already subscribed to this session</p>
                <button type="button"  class="btn-lg buttons">Go Back</button>
            </div>

        )
    }
}
export default Error
